def δ (x : ℕ) : ℕ :=
  if h : x ≠ 0 then
    let divisors := Finset.filter (λ d, Nat.Odd d ∧ d ∣ x) (Finset.range (x + 1))
    divisors.max' (Finset.nonempty_of_ne_empty (Finset.ne_empty_of_exists_mem (exists_odd_divisor_of_ne_zero h)))
  else 1

def δ (x : ℕ) : ℕ :=
  let divisors := {d : ℕ | d ∣ x ∧ d % 2 = 1}
  in if h : divisors.nonempty then divisors.min' h else 1

def δ (x : ℕ) : ℕ :=
  if h : x > 0 then
    let d := (Finset.filter (λ d, d % 2 = 1 ∧ d ∣ x) (Finset.range (x + 1))).max' (Finset.nonempty_of_ne_empty (by {
      have h1 : ∃ d, d % 2 = 1 ∧ d ∣ x := Exists.intro 1 (And.intro (Nat.odd_iff_not_even.mpr (by decide)) (dvd_refl x)),
      exact Finset.nonempty_of_exists h1
    }))
    in d
  else
    0
